import React, { Component } from 'react'
import Student from "../pages/Student"
export default class Navbar extends Component {
    render() {
        return (
             <div className="app">
        <div className="header">
          <header >
            <span >CAMPUS RECUIREMENT APP</span>

            <a onClick={this.campusloginfunc} > campus login</a>

            <a onClick={this}  ></a>

            <a onClick={this.companyloginfunc}>company login</a>
          </header>
        </div>
        <div className="app">

        </div>
      </div>
           
        )
    }
}
